theme_mods.custom_css_string:
/* body-typography 
=========================*/
body{ font-family:'Kulim Park'; } 
/* header-logo-width 
=========================*/
.aux-logo-header .aux-logo-anchor{ max-width:80px; }
/* header-logo-max-height-type 
=========================*/
.aux-logo-header .aux-logo-anchor > img { max-height:85px; }
/* site-frame-background-color 
=========================*/
@media screen and (min-width: 700px) { .aux-framed .aux-side-frames, body.aux-framed:after,
            .aux-framed .aux-side-frames:before, .aux-framed .aux-side-frames:after{ background-color:#111111; } }
/* sticky-header-color 
=========================*/
.site-header-section.aux-sticky, .aux-elementor-header.aux-sticky { background-color:#FFFFFF; }
/* site-header-container-scaled-height 
=========================*/
.aux-top-sticky .site-header-section.aux-sticky .aux-fill .aux-menu-depth-0 > .aux-item-content, .aux-top-sticky .site-header-section.aux-sticky .aux-header-elements,.aux-elementor-header.aux-sticky { height:80px; }
/* site-header-container-height 
=========================*/
.site-header-section .aux-header-elements:not(.aux-vertical-menu-elements), .site-header-section .aux-fill .aux-menu-depth-0 > .aux-item-content { height:85px; }
/* site-transparent-header-bgcolor 
=========================*/
.site-header-section { background-color:#FFFFFF; }
/* site-vertical-menu-background-color 
=========================*/
.aux-vertical-menu-side  { background-color:#FFF; }
/* site-header-navigation-item-height 
=========================*/
.site-header-section .aux-middle .aux-menu-depth-0 > .aux-item-content { height:60px; }
/* site-mobile-header-toggle-button-color 
=========================*/
.site-header-section .aux-header .aux-burger:before, .site-header-section .aux-header .aux-burger:after, .site-header-section .aux-header .aux-burger .mid-line{ border-color:#3d3d3d; }
/* site-menu-full-screen-background-color 
=========================*/
#fs-menu-search:before { background-color:rgba(255, 255, 255, 0.95); }
/* site-top-header-background-color 
=========================*/
#top-header{background-color:#FFFFFF;}
/* blog-post-like-icon-size 
=========================*/
.single-post .wp_ulike_general_class button::before { font-size:27px; }
/* blog-post-share-button-icon-size 
=========================*/
.single-post .aux-single-post-share span::before { font-size:27px; }
/* post-title-bar-overlay-pattern-opacity 
=========================*/
.single-post .aux-overlay-bg-hash::before { opacity:0.15; }
/* page-title-bar-overlay-pattern-opacity 
=========================*/
.page .aux-overlay-bg-hash::before { opacity:0.5; }
/* subfooter-bar-layout-bg-color 
=========================*/
.aux-subfooter-bar { background-color:#fafafa; }
/* subfooter-bar-top-border-color 
=========================*/
.aux-subfooter-bar { border-top:1px solid #EAEAEA; }
/* subfooter-layout-bg-image-position 
=========================*/
.aux-subfooter{background-position:center center;}
/* subfooter-layout-bg-image-size 
=========================*/
.aux-subfooter{background-size:cover;}
/* subfooter-layout-bg-image-repeat 
=========================*/
.aux-subfooter{background-repeat:no-repeat;}
/* subfooter-top-border-color 
=========================*/
.aux-subfooter { border-top:1px solid #EAEAEA; }
/* site-footer-bg-color 
=========================*/
.aux-site-footer{background-color:#1A1A1A;}
/* footer-top-border-color 
=========================*/
.aux-site-footer{border-top:1px solid #EAEAEA;}
/* footer-top-border-width 
=========================*/
.aux-site-footer { border-top-width:1px; }
/* site-secondary-logo-max-height 
=========================*/
.aux-logo-footer .aux-logo-anchor img { max-height:50px; }
/* product-title-bar-overlay-pattern-opacity 
=========================*/
.single-product .aux-overlay-bg-hash::before { opacity:0.5; }
/* general-heading-h1 
=========================*/
body h1, body .aux-h1{ font-family:'Kulim Park'; } 
/* general-heading-h2 
=========================*/
body h2, body .aux-h2{ font-family:'Kulim Park'; } 
/* general-heading-h3 
=========================*/
body h3, body .aux-h3{ font-family:'Kulim Park'; } 
/* general-heading-h4 
=========================*/
body h4, body .aux-h4{ font-family:'Kulim Park'; } 
/* general-heading-h5 
=========================*/
body h5, body .aux-h5{ font-family:'Kulim Park'; } 
/* site-featured-color-1 
=========================*/
:root{--auxin-featured-color-1: #1173f8;}
/* site-featured-color-2 
=========================*/
:root{--auxin-featured-color-2: #ffffff;}
/* site-featured-color-3 
=========================*/
:root{--auxin-featured-color-3: #101010;}
/* product-setting-section-shop-page-product-title-typo 
=========================*/
.aux-shop-archive .products-loop .auxshp-loop-title{ color:rgb(16, 16, 16); font-size:24px; font-weight:600; line-height:1.3em; } 
/* product-setting-section-shop-page-product-price-typo 
=========================*/
.aux-shop-archive .products-loop .price .amount, .aux-shop-archive .products-loop .price ins .amount{ color:rgb(16, 16, 16); font-size:26px; font-weight:300; } 
/* sidebar-common-widget-title-typography 
=========================*/
.aux-sidebar .widget-title{ color:rgb(22, 22, 22); font-size:23px; font-weight:700; text-transform:capitalize; line-height:1.3em; letter-spacing:-0.6px; } 
/* sidebar-global-typography 
=========================*/
.aux-sidebar{ color:rgb(22, 22, 22); font-size:18px; font-weight:400; text-decoration:none; } 
/* product-setting-section-shop-page-result-typo 
=========================*/
.woocommerce-page .woocommerce-result-count{ color:rgb(78, 78, 78); font-size:15px; font-weight:400; line-height:1.3px; } 
/* product-setting-section-shop-page-sales-badge-typo 
=========================*/
.aux-shop-archive .products-loop .onsale{ color:rgba(217, 59, 59, 0); } 
/* product-setting-section-shop-page-product-reg-price-typo 
=========================*/
.aux-shop-archive .products-loop .price del,  .aux-shop-archive .products-loop .price del .amount{ color:rgba(0, 0, 0, 0.33); font-size:15px; } 
/* product-setting-section-single-appearance-title 
=========================*/
.single-product .entry-title{ font-size:36px; font-weight:800; color:rgb(22, 22, 22); line-height:1.3em; } 
@media(max-width: 1024px){ .single-product .entry-title{ font-size:24px; }  } 
/* product-setting-section-single-appearance-price 
=========================*/
.single-product .price .amount, .single-product .price ins .amount{ color:rgba(17, 115, 248, 0.69); font-size:41px; font-weight:300; } 
@media(max-width: 1024px){ .single-product .price .amount, .single-product .price ins .amount{ font-size:26px; }  } 
/* product-setting-section-single-appearance-reg-price 
=========================*/
.single-product .price del .amount, .single-product .price del{ color:rgba(16, 16, 16, 0.5); font-size:26px; } 
@media(max-width: 1024px){ .single-product .price del .amount, .single-product .price del{ font-size:20px; }  } 
/* product-setting-section-single-appearance-star-text 
=========================*/
.single-product .woocommerce-review-link{ color:rgba(17, 115, 248, 0.5); font-size:18px; font-weight:500; line-height:1.5em; } 
@media(max-width: 1024px){ .single-product .woocommerce-review-link{ font-size:15px; }  } 
/* product-setting-section-single-appearance-description 
=========================*/
.single-product .woocommerce-product-details__short-description{ color:rgb(125, 125, 125); font-size:16px; font-weight:400; line-height:1.5em; } 
@media(max-width: 1024px){ .single-product .woocommerce-product-details__short-description{ font-size:14px; }  } 
/* product-setting-section-single-appearance-category 
=========================*/
.single-product .auxshp-cats-wrapper .auxshp-label{ color:rgb(22, 22, 22); font-size:17px; font-weight:700; line-height:1.3em; letter-spacing:1.02px; } 
@media(max-width: 1024px){ .single-product .auxshp-cats-wrapper .auxshp-label{ font-size:16px; }  } 
/* product-setting-section-single-appearance-category-terms 
=========================*/
.single-product .auxshp-cats-wrapper .auxshp-meta-terms, .single-product .auxshp-cats-wrapper .auxshp-meta-terms a{ color:rgb(151, 151, 151); font-size:17px; font-weight:400; line-height:1.3em; } 
@media(max-width: 1024px){ .single-product .auxshp-cats-wrapper .auxshp-meta-terms, .single-product .auxshp-cats-wrapper .auxshp-meta-terms a{ font-size:14px; }  } 
/* product-setting-section-single-appearance-tabs-title 
=========================*/
.woocommerce-page .woocommerce-tabs .tabs li a{ color:rgb(22, 22, 22); font-size:25px; font-weight:600; line-height:1.4em; } 
@media(max-width: 1024px){ .woocommerce-page .woocommerce-tabs .tabs li a{ font-size:25px; }  } 
/* product-setting-section-single-appearance-add-to-btn 
=========================*/
.single-product .cart .auxshp-add-to-cart{ font-family:'Kulim Park'; color:rgb(255, 255, 255); font-size:15px; font-weight:400; line-height:1.3em; letter-spacing:0.45px; } 
@media(max-width: 1024px){ .single-product .cart .auxshp-add-to-cart{ font-size:13px; }  } 
/* product-setting-section-single-appearance-tabs-content 
=========================*/
.single-product .woocommerce-tabs .tabs-content{ color:rgb(125, 125, 125); font-size:16px; font-weight:400; line-height:1.6em; } 
/* product-related-posts-title-typo 
=========================*/
.aux-widget-related-products .auxshp-entry-main .auxshp-loop-title{ color:rgb(22, 22, 22); font-size:24px; font-weight:600; line-height:1.5em; } 
/* product-related-posts-price-typo 
=========================*/
.aux-widget-related-products .auxshp-entry-main .price .amount , .aux-widget-related-products .auxshp-entry-main .price ins .amount{ color:rgb(16, 16, 16); font-size:26px; font-weight:300; line-height:1.3em; } 
/* product-related-posts-label-typo 
=========================*/
.single-product .auxshp-related-products .widget-title{ font-size:45px; color:rgb(22, 22, 22); font-weight:700; } 
/* comment-forms-response-title-typo 
=========================*/
.comments-title, .comment-reply-title{ font-size:30px; color:rgb(30, 30, 30); font-weight:600; line-height:1.3em; text-transform:capitalize; } 
/* comment-forms-button-typo 
=========================*/
#commentform .form-submit input[type="submit"]{ font-size:16px; font-weight:400; color:rgb(255, 255, 255); letter-spacing:0.48px; line-height:1.5em; text-transform:uppercase; } 
/* comment-forms-label-typo 
=========================*/
#commentform label{ font-size:18px; color:rgb(125, 125, 125); font-weight:300; line-height:1.3em; } 
/* product-setting-section-single-appearance-review-author 
=========================*/
.single-product .woocommerce-review__author{ color:rgb(30, 30, 30); font-size:26px; font-weight:700; letter-spacing:0.52px; line-height:1.5em; } 
/* product-setting-section-single-appearance-review-date 
=========================*/
.single-product .woocommerce-review__published-date{ color:rgb(135, 135, 135); font-size:16px; font-weight:300; line-height:1.3em; } 
/* product-setting-section-single-appearance-review-content 
=========================*/
.single-product .woocommerce-Reviews .comment-text{ font-size:16px; font-weight:400; color:rgb(78, 78, 78); line-height:1.8em; } 
/* product-setting-section-single-appearance-review-title 
=========================*/
.single-product .woocommerce-Reviews-title{ font-size:26px; } 
/* product-setting-section-single-appearance-meta-field 
=========================*/
.single-product .aux-shop-meta-field span{ font-size:16px; } 
@media(max-width: 1024px){ .single-product .aux-shop-meta-field span{ font-size:16px; }  } 
/* product-single-wishlist-button-icon-size 
=========================*/
.single-product .auxshp-wishlist .auxshp-wishlist-icon::before { font-size:27px; }
/* product-single-share-button-icon-size 
=========================*/
.single-product .aux-share-btn span::before { font-size:27px; }

